};

const Form = () => {
  return (
    <form>
      <input type='text' placeholder='github name' required />
      <button>add name</button>
    </form>
  );
};

const Card = (props) => {
  const profiles = testData[0];
  return (
    <div className='github-profile'>
      <img src={profiles.avatar_url} />
      <div className='info'>
        <div className='name'> {profiles.name}</div>
        <div className='company'>{profiles.company}</div>
      </div>
    </div>
  );
};

function App() {
  state = {
    profiles: testData
  };
  return (
    <div className='App'>
      <Form />
      <Card />
    </div>
  );
}

export default App;
